import axios from 'axios';
// process.env.REACT_APP_BE_URL

const instance = axios.create({
    baseURL: process.env.REACT_APP_BE_URL
})


const login = body => {
    axios.get("todos/1")
    .then((res)=>{
        console.log(res)
    })
    .catch((err)=>{
        console.log(res)
    })

}

export {login}
console.log(baseURL)
